// Contoh di Navbar.jsx (jika ada), atau di App.jsx di bagian header/menu

import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav style={{ padding: '10px 20px', backgroundColor: '#fce4ec', display: 'flex', gap: '20px' }}>
      {/* Tombol Tren Pencarian */}
      <Link 
        to="/trending" 
        style={{
          textDecoration: 'none',
          padding: '10px 20px',
          borderRadius: '30px',
          backgroundColor: '#ec407a',
          color: 'white',
          fontWeight: '600',
          transition: 'background-color 0.3s ease'
        }}
        onMouseEnter={e => e.target.style.backgroundColor = '#d81b60'}
        onMouseLeave={e => e.target.style.backgroundColor = '#ec407a'}
      >
        Tren Pencarian
      </Link>
      {/* Tambahkan menu lain jika perlu */}
    </nav>
  );
}
